import React from "react";
import PlayerCardList from "./PlayerCardList";
import ButtonSelect from "./ButtonSelect";
import ButtonSetList from "./ButtonSetList";
import "./App.css";
const App = () => {
  return (
    <div className="main-container">
      <div className={`main-container__players clearfix `}>
        <PlayerCardList />
      </div>
      <div className="main-container__buttons">
        <ButtonSelect />
        <ButtonSetList />
      </div>
    </div>
  );
};

export default App;
